import React from "react";
import { Link } from "react-router-dom";

const Sidebar = () => {
  return (
    <div className="md:mt-16 top-0 w-full text-center md:w-48 md:h-screen md:h-full fixed md:bg-gray-100">
        <nav>
          <ul className="flex md:block justify-center md:text-left">
            <li className="hover:bg-purple-400 transition duration-400 px-4 py-2 md:px-0 md:py-0">
              <Link to="/" className="inline-block w-full">Home</Link>
            </li>
            <li className="hover:bg-purple-400 transition duration-400 px-4 py-2 md:px-0 md:py-0">
              <Link to="/shoes" className="inline-block w-full">Shoes</Link>
            </li>
            <li className="hover:bg-purple-400 transition duration-400 px-4 py-2 md:px-0 md:py-0">
              <Link to="/technology" className="inline-block w-full">Technology</Link>
            </li>
            <li className="hover:bg-purple-400 transition duration-400 px-4 py-2 md:px-0 md:py-0">
              <Link to="/shirts" className="inline-block w-full">Shirts</Link>
            </li>
          </ul>
        </nav>
    </div>
  );
};

export default Sidebar;
